--
-- Table structure for table `bw_inmoney`
--

DROP TABLE IF EXISTS `bw_inmoney`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bw_inmoney` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `pay_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '存款账户ID，bw_admission.id',
  `in_model` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '稽核(存款)模式, bw_deposit_config.id',
  `in_type` enum('人工存入','负数额度归零','活动优惠','返点优惠','人工存款','其他') NOT NULL COMMENT '存入类型',
  `pay_scheme` enum('MX','MS','MR') NOT NULL DEFAULT 'MX' COMMENT 'MX:线下入款,MS:线上入款,MR:人工存入',
  `manage_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '操作员ID',
  `money` float(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '存入多少钱,单位是元',
  `nick` varchar(20) NOT NULL DEFAULT '' COMMENT '前台填写微信昵称,如果后台录入,就没有这个值了',
  `audit` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '{常态稽核量}需要稽核的打码量(不达标的情况下,收回server_fee)',
  `audit_set` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否为手动设置的稽核打码量',
  `server_fee` float(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '可能需要收取的服务费,打码量不达标的时候',
  `synthetical_audit_set` tinyint(4) DEFAULT NULL COMMENT '是否设置综合打码',
  `synthetical_audit` float(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '{综合稽核打码量}综合打码量设定,设置了,这里就有值了(综合打码量不达标,扣回remit_money)',
  `remit_set` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否手动修改了存款普通额',
  `remit_money` float(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '手动设置了存款普通优惠额额度,单位元【存款优惠】',
  `remit_remark` varchar(100) NOT NULL DEFAULT '' COMMENT '汇款优惠额备注',
  `deposit_set` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否手动修改了存款额外优惠额',
  `deposit_money` float(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '手动设置的存款额外优惠额度,单位元【汇款优惠】',
  `deposit_remark` varchar(100) NOT NULL DEFAULT '' COMMENT '存款优惠额度备注',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态,0未确认,1已充值,-1拒绝',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `lock_at` timestamp NULL DEFAULT NULL COMMENT '锁定时间,在多久之后会超时,其他用户也可以操作,一般10分钟后可以操作就可以了',
  `lockuid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '锁定的用户,只有锁定的用户可以操作',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='充值订单';
/*!40101 SET character_set_client = @saved_cs_client */;

