DROP TABLE IF EXISTS `bw_iomodel_config`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bw_iomodel_config` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '存取款模式，默认0为存款，1为取款',
  `lock` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '设置设定，设定的状态不允许操作和删除',
  `del` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否启用，启用为1，默认不弃用，为0',
  `name` varchar(50) NOT NULL DEFAULT '0' COMMENT '模式名称',
  `max_in` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '存款额度设定：单次最高存入，整数，单位，元',
  `min_in` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '存款额度设定：单次最低存入，整数，单位，元',
  `discount_number_in` tinyint(4) NOT NULL DEFAULT '0' COMMENT '存款普通优惠设定（可计入取款稽核）：存款优惠次数，0没有优惠，1首次，-1每次，2-127表示多少次优惠',
  `can_give_in` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '存款普通优惠设定（可计入取款稽核）：是否可以放弃优惠，1能，0不能',
  `discount_stat_in` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '存款普通优惠设定（可计入取款稽核）：单次存款达到多少进行优惠',
  `discount_scale_in` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '存款普通优惠设定（可计入取款稽核）：优惠比率，单位1%',
  `discount_top_in` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '存款普通优惠设定（可计入取款稽核）：单次优惠上限金额，单位元',
  `discount_number_iin` tinyint(4) NOT NULL DEFAULT '0' COMMENT '存款额外优惠设定（不计入取款稽核）：存款优惠次数，0没有优惠，1首次，-1每次，2-127表示多少次优惠',
  `discount_stat_iin` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '存款额外优惠设定（不计入取款稽核）：单次存款达到多少进行优惠',
  `discount_scale_iin` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '存款额外优惠设定（不计入取款稽核）：优惠比率，单位1%',
  `discount_top_iin` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '存款额外优惠设定（不计入取款稽核）：单次优惠上限金额，单位元',
  `audit_in` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '常态性稽核打码量：启用或者关闭，1启用，0关闭',
  `discount_chip_in` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '常态性稽核：额外可放宽打码量设定，0表示不优惠',
  `audit_scale_in` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '常态性稽核打码量下的比例设置：单位1%',
  `service_scale_in` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '常态性稽核：手续费率',
  `audit_iin` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '普通优惠设定：普通优惠稽核设定，0关闭，1启动',
  `discount_chip_iin` decimal(3,1) unsigned NOT NULL DEFAULT '0.0' COMMENT '普通优惠设定：打码量大于？？倍，获得优惠',
  `remark_in` varchar(100) NOT NULL DEFAULT '0' COMMENT '普通用户设定：备注',
  `discount_number_out` tinyint(4) DEFAULT NULL COMMENT '取款设定：达到多少次后，免手续费，0表示每次都需要收取',
  `service_fee_out` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '取款设定：取款手续费，单位元',
  `day_number_out` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '取款设定：每日允许取款次数',
  `wait_set_out` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '取款设定：取款等待审核时间，1启用，0关闭',
  `top_money_out` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '取款设定：取款大于等于？？元人民币是，等待？？小时单位元',
  `wait_time_out` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '取款设定：取款大于等于？？元人民币是，等待？？小时单位，小时',
  `max_out` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '取款设定：单次最高取款金额，单位元',
  `min_out` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '取款设定：单次最低取款金额，单位元',
  `remark_out` varchar(100) NOT NULL DEFAULT '0' COMMENT '取款设定：备注',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存取款模式设定，包含了存款，取款两种\r\n依据type字段来确定,0存款，1取款，default为0\r\n已废除';
/*!40101 SET character_set_client = @saved_cs_client */;

