/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bw_outmoney` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `withdraw_config_id` int(11) NOT NULL DEFAULT '0' COMMENT '稽核模式,对应 bw_withdraw_money_config.id',
  `manage_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '操作员ID',
  `pay_scheme` enum('MT','MC') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'MT:人工提出,MC:线下提现',
  `bank_card_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'bw_bank_card.id，提出到哪个银行卡',
  `withdraw_type` enum('重复出款','公司入款失误','会员负数回冲','手动申请出款','扣除非法下注派彩','放弃存款优惠','误存提出','其他') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '提出类型',
  `withdraw_money` float(10,2) NOT NULL COMMENT '提出金额',
  `withdraw_money_actual` bigint(20) unsigned zerofill NOT NULL COMMENT '实际提出金额，在审核未通过之前为冻结金额',
  `de_discount` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '扣除普通优惠金额，单位分',
  `de_audit` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '扣除行政【稽核】费，单位分',
  `de_service_charge` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '扣除手续费(后台工作人员手工扣除手续费)',
  `de_overtime_charge` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '超出当天出款次数手续费(对应出款模型的超出取款次数扣除手续费)',
  `is_first` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否首次出款，1：是，0：不是',
  `discount_removed` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否扣除优惠, 1:是;0:否',
  `bank_name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '出款银行，冗余保存',
  `remark` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '备注',
  `lock_uid` int(11) NOT NULL DEFAULT '0' COMMENT '锁定的用户,只有锁定的用户可以操作',
  `lock_at` timestamp NULL DEFAULT NULL COMMENT '锁定时间,在多久之后会超时,其他用户也可以操作,一般10分钟后可以操作就可以了',
  `status` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态,0：未确认; -1：拒绝; 1：已发放;',
  `audit_ids` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '出款操作时关联打码表充值入账的id,用逗号隔开',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
