--
-- Table structure for table `bw_outmoney_old`
--

DROP TABLE IF EXISTS `bw_outmoney_old`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bw_outmoney_old` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `pay_type` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付方式',
  `out_model` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '稽核模式,对应 bw_withdraw_money_config.id',
  `pay_scheme` enum('MT','MC') NOT NULL DEFAULT 'MT' COMMENT 'MT:人工提出,MC:线下提现',
  `manage_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '操作员ID',
  `money` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '取出多少钱,单位是分',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态,0未确认,-1,禁止,1已发放',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `lock_at` timestamp NULL DEFAULT NULL COMMENT '锁定时间,在多久之后会超时,其他用户也可以操作,一般10分钟后可以操作就可以了',
  `lockuid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '锁定的用户,只有锁定的用户可以操作',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `de_discount` int(11) NOT NULL DEFAULT '0' COMMENT '扣除优惠金额，单位分',
  `de_audit` int(11) NOT NULL DEFAULT '0' COMMENT '扣除行政【稽核】费，单位分',
  `de_service_charge` int(11) NOT NULL DEFAULT '0' COMMENT '扣除手续费',
  `de_overtime_charge` int(11) NOT NULL DEFAULT '0' COMMENT '超出当天出款次数手续费',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='充值订单';
/*!40101 SET character_set_client = @saved_cs_client */;

