DROP TABLE IF EXISTS `bw_promote_config`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bw_promote_config` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(10) unsigned NOT NULL DEFAULT '0',
  `account_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '账号类型#1会员；2代理',
  `link_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '链接类型#1站内；2外链',
  `promote_url` varchar(100) NOT NULL DEFAULT '' COMMENT '推广链接',
  `key` varchar(20) NOT NULL DEFAULT '' COMMENT '推广key 带在链接后',
  `manage_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '操作的管理员id',
  `is_del` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '是否删除#1已删除；2正常',
  `is_default` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否默认#1是',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0',
  `updatetime` int(10) unsigned NOT NULL DEFAULT '0',
  `register_num` int(11) NOT NULL DEFAULT '0' COMMENT '注册人数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=194 DEFAULT CHARSET=utf8 COMMENT='代理推广链接配置';
/*!40101 SET character_set_client = @saved_cs_client */;

