--
-- Table structure for table `bw_user_info`
--

DROP TABLE IF EXISTS `bw_user_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bw_user_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '账号id',
  `parent_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上级uid',
  `promote_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'promote_config.id',
  `parent_uid_dir` varchar(500) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '上级代理uid路径，例： 123;456;789;',
  `register_url` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '注册的链接',
  `hierarchy` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '层级',
  `nickname` varchar(30) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '账号昵称',
  `real_name` varchar(30) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '真实姓名',
  `money_password` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '提现密码',
  `birthday` varchar(200) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '生日',
  `qq` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'qq号',
  `wechat` varchar(50) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '微信号',
  `mobile` varchar(30) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `note` varchar(500) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `level_id` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '用户等级, bw_level.id',
  `register_ip` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '注册ip',
  `login_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '登录时间',
  `login_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '登录次数',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `group_id` int(11) NOT NULL DEFAULT '0' COMMENT '分组id, bw_user_group.id',
  `user_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '用户类型，1：会员， 2:代理， 3:试玩',
  `pic_id` int(11) DEFAULT NULL COMMENT '头像id，对应sys_file',
  `sex` tinyint(4) NOT NULL DEFAULT '0' COMMENT '性别，1男2女0未知',
  `status1` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1:启用， 0：禁用',
  `status2` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1:允许投注， 0：暂停投注',
  `status3` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1:解冻，0：冻节',
  `status4` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1:拉白，0：拉黑',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=217 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='用户信息表';
